CCNP Routing &amp; Switching 
Video Course Download

Learn from the leaders in network training with over 46 hours of downloadable, in-depth instruction! Our CCNP video course is simply the best available training, covering the 642-902 ROUTE, 642-813 SWITCH, and 642-832 TSHOOT exams. You may view this course on your computer or any MP4-compatible mobile device.

This course is taught by Brian McGahan, CCIEx4 #8593 (Routing &amp; Switching, Data Center, Security, Service Provider), CCDE #2013::13 (Design).
